import React from 'react';
import "./header.css"
import logo from "../brainster_space_logo.svg";
const Header = () => {
    return ( 
        <div className="header">
             <ul>
                 <li>
            <img src={logo}></img>

                 </li>
                 <li>SPACE БЛОГ</li>
                 <li>НАСТАНИ</li>
                 <li>CO-WORKING</li>
                 <li>АКАДЕМИИ</li>
                 <li>ПРОСТОР ЗА НАСТАНИ</li>
                 <li>ПАРТНЕРСТВА</li>
                 <li>ПРИКЛУЧИ СЕ</li>
             </ul>

        </div>
     );
}
 
export default Header;
